import { useState } from 'react';


export default function NameInput () {
    const [name, setName] = useState(3);
    let style;

    function handleOnChange (e) {
        setName(e.target.value)
    }


    return (
        <label className='formElement' id='nameLabel'>
            Name
            <input 
                id='nameElement'
                type='text'
                value={name}
                onChange={handleOnChange}
                style={style}>
            </input>
        </label>
    )
}
